  false,\n\t\"url\": null,\n\t\"notes\": \"Final report for the study of bullsnake
  ecology and management at the Crescent Lake National Wildlife Refuge This study
  was initiated with the primary goal of using radio telemetry to reveal aspects of
  the spatial biology of bullsnakes that could be exploited towards the reduction
  of bullsnake numbers in the waterfowl nesting meadows. Three particular methods
  were u00b7 closely examined for their potential to reduce bullsnake numbers in the
  waterfowl nesting meadows; 1, locating and destroying communal hibernacula, 2. habitat
  management, and 3. removal trapping.  This final report begins with a general description
  of the utilization of the waterfowl nesting meadows by bullsnakes and their movements
  to and from the meadows. Following this are the results of the investigation of
  the three proposed bullsnake control techniques.\",\n\t\"license_title\": \"License
